contract Dungeon is ERC721Enumerable, ReentrancyGuard, Ownable {
    uint256 public price = 20000000000000000; //0.02 ETH

    //Loot Contract
    address public lootAddress = 0xFF9C1b15B16263C61d017ee9F65C50e4AE0113D7;
    LootInterface public lootContract = LootInterface(lootAddress);

    uint public constant ROWS = 16;
    uint public constant COLS = 32;
    uint public constant RAND_MAX = 240;

    struct RoomInfo {
        uint256 token_id;
        uint8 door_side_tb;
        uint8 door_side_lr;
        uint8 room_height;
        uint8 room_width;
        uint8 room_x;
        uint8 room_y;
        uint8 door_pos_tb;
        uint8 door_pos_lr;
    }

    struct RawRow {
        bytes row;
        bytes items;
    }

    struct FullRow {
        string output;
        bytes items;
    }

    struct TokenInfo {
        string output;
        string attributes;
        string json;
        string item_list;
    }

    // Characters used in dungeon generation
    // Base dungeon
    string private constant c_empty = " ";          // Empty (0)
    string private constant c_floor = ".";          // Floor (1)
    string private constant c_vwall = unicode"║";   // Vertical wall (2)
    string private constant c_hwall = unicode"═";   // Horizontal wall (3)
    string private constant c_door = unicode"Ω";    // Horizontal or vertical door (4)
    string private constant c_path = unicode"#";    // Horizontal or vertical door (4)
    string private constant c_tlwall = unicode"╔";  // Top left corner wall (5)
    string private constant c_trwall = unicode"╗";  // Top right corner wall (6)
    string private constant c_blwall = unicode"╚";  // Bottom left corner wall (7)
    string private constant c_brwall = unicode"╝";  // Bottom right corner wall (8)
    string private constant c_ladder = "H";         // Stairs up / down (10) - u

    // Items in dungeon - Ranges for rarity - c=8, u=4, r=2, ur=1
    string private constant c_treasure = "$";       // Treasure (Bitcoin) (11) - ur
    string private constant c_bow = "}";            // Bow (12) - u
    string private constant c_weapon = "w";         // Weapon (13) - c
    string private constant c_battle = "b";         // Random battle (14) - c
    string private constant c_ring = "o";           // Ring (15) - r
    string private constant c_boss = "B";           // Boss (16) - r
    string private constant c_npc = "N";            // NPC character / Amulet (17) - u
    string private constant c_bomb = "*";           // Bomb (18) - c
    string private constant c_potion = "P";         // Potion (19) - c
    string private constant c_trap = "X";           // Trap (20) - c
    string private constant c_altar = "T";          // Altar (Magic regen) (21) - u
    string private constant c_health = "h";         // Cross (Health Regen) (22) - c
    string private constant c_teleporter = "@";     // Teleporter (23) - ur
    string private constant c_shield = "O";         // Armour (24) - u
    string private constant c_food = "%";           // Food (25) - c
    string private constant c_staff = "J";          // Staff (26) - u

    // Now the array of the above types indexed by identifier
    string[] private items = [
        c_empty,        // 0x00
        c_floor,        // 0x01
        c_vwall,        // 0x02
        c_hwall,        // 0x03
        c_door,         // 0x04
        c_path,         // 0x05
        c_tlwall,       // 0x06
        c_trwall,       // 0x07
        c_blwall,       // 0x08
        c_brwall,       // 0x09
        c_ladder,       // 0x0a
        c_treasure,     // 0x0b
        c_bow,          // 0x0c
        c_weapon,       // 0x0d
        c_battle,       // 0x0e
        c_ring,         // 0x0f
        c_boss,         // 0x10
        c_npc,          // 0x11
        c_bomb,         // 0x12
        c_potion,       // 0x13
        c_trap,         // 0x14
        c_altar,        // 0x15
        c_health,       // 0x16
        c_teleporter,   // 0x17
        c_shield,       // 0x18
        c_food,         // 0x19
        c_staff         // 0x1a
    ];

    // Item names starting from ladder down (item id - 10)
    string[] private itemNames = [
        "Ladder",
        "Treasure",
        "Bow",
        "Weapon",
        "Battle",
        "Ring",
        "Boss",
        "NPC",
        "Bomb",
        "Potion",
        "Trap",
        "Altar",
        "Health Regen",
        "Teleporter",
        "Shield",
        "Food",
        "Staff"
    ];

    // Indexes of the above
    // Base dungeon
    uint8 private constant i_empty = 0;               // Empty (0)
    uint8 private constant i_floor = 1;               // Floor (1)
    uint8 private constant i_vwall = 2;               // Vertical wall (2)
    uint8 private constant i_hwall = 3;               // Horizontal wall (3)
    uint8 private constant i_door = 4;                // Horizontal or vertical door (4)
    uint8 private constant i_path = 5;                // Horizontal or vertical door (5)
    uint8 private constant i_tlwall = 6;              // Top left corner wall (6)
    uint8 private constant i_trwall = 7;              // Top right corner wall (7)
    uint8 private constant i_blwall = 8;              // Bottom left corner wall (8)
    uint8 private constant i_brwall = 9;              // Bottom right corner wall (9)
    uint8 private constant i_ladder = 10;             // Stairs up / down (10)

    // Items in dungeon
    uint8 private constant i_treasure = 11;           // Treasure (Bitcoin) (11)
    uint8 private constant i_bow = 12;                // Bow (12)
    uint8 private constant i_weapon = 13;             // Weapon (13)
    uint8 private constant i_battle = 14;             // Random battle (14)
    uint8 private constant i_ring = 15;               // Ring (15)
    uint8 private constant i_boss = 16;               // Boss (16)
    uint8 private constant i_npc = 17;                // NPC character / Amulet (17)
    uint8 private constant i_bomb = 18;               // Bomb (18)
    uint8 private constant i_potion = 19;             // Magic Potion (19)
    uint8 private constant i_trap = 20;               // Trap (20)
    uint8 private constant i_altar = 21;              // Altar (Magic regen) (21)
    uint8 private constant i_health = 22;             // Cross (Health Regen) (22)
    uint8 private constant i_teleporter = 23;         // Teleporter (23)
    uint8 private constant i_shield = 24;             // Armour (24)
    uint8 private constant i_food = 25;               // Food (25)
    uint8 private constant i_staff = 26;              // Staff (26)

    function random(string memory input) internal pure returns (uint256) {
        return uint256(keccak256(abi.encodePacked(input)));
    }

    function randomItem(uint i) internal pure returns (uint8) {
        return i < 30 ? i_floor :
                    i >= 30 && i <34 ? i_ladder : 
                    i == 35 ? i_treasure :
                    i >= 36 && i <40 ? i_bow :
                    i >= 40 && i <48  ? i_weapon :
                    i >= 48 && i <56  ? i_battle :
                    i >= 56 && i <58  ? i_ring :
                    i >= 58 && i <60 ? i_boss :
                    i >= 60 && i <62  ? i_npc :
                    i >= 62 && i <70  ? i_bomb :
                    i >= 70 && i <78  ? i_potion :
                    i >= 78 && i <86  ? i_trap :
                    i >= 86 && i <90  ? i_altar :
                    i >= 90 && i <98  ? i_health :
                    i == 98 ? i_teleporter :
                    i >= 99 && i <103  ? i_shield :
                    i >= 103 && i <111  ? i_food :
                    i >= 111 && i <115  ? i_staff :
                    i_floor;
    }

    function getRowData(uint8 rowNum, RoomInfo memory r) internal pure returns (RawRow memory rr) {
        bytes memory row = new bytes(r.room_width);
        bytes memory item_row = new bytes(COLS);           // Zero filled by default
        uint8 item_ptr = 0;

        // Setup the row data
        if(rowNum == 0) {               // Top row
            for(uint x=0; x < r.room_width; x++) {
                row[x] = bytes1(uint8(x==0 ? i_tlwall : 
                                        x==r.room_width-1 ? i_trwall : 
                                        r.door_side_tb==0  && r.door_pos_tb+2 == x ? i_door : 
                                        i_hwall));
            }
        } else if(rowNum == r.room_height-1) {   // Bottom row
            for(uint x=0; x < r.room_width; x++) {
                row[x] = bytes1(uint8(x==0 ? i_blwall : 
                                        x==r.room_width-1 ? i_brwall : 
                                        r.door_side_tb==1  && r.door_pos_tb+2 == x ? i_door : 
                                        i_hwall));
            }
        } else {                        // Middle rows
            uint256 rand_num = random(string(abi.encodePacked("Item", toString(r.token_id), toString(rowNum)))) % RAND_MAX;
            bytes1 item_id;
            item_id = bytes1(randomItem(rand_num));
            uint256 rand_pos;
            if(item_id == bytes1(i_floor)) rand_pos = 2 * r.room_width;
            else {
                rand_pos = random(string(abi.encodePacked("Position", toString(r.token_id), toString(rowNum), toString(r.door_pos_lr)))) % (r.room_width-2);
                if(item_id != bytes1(uint8(i_floor))) item_row[item_ptr++] = bytes1(uint8(item_id));
            }

            for(uint x=0; x < r.room_width; x++) {
                row[x] = (x==0 && r.door_side_lr==1 && r.door_pos_lr+2 == rowNum) ? bytes1(i_door) : 
                         (x==r.room_width-1 && r.door_side_lr==0 && r.door_pos_lr+2 == rowNum) ? bytes1(i_door) :
                         (x==0 || x==r.room_width-1) ? bytes1(i_vwall) :
                         (x > 0 && x-1==rand_pos) ? bytes1(uint8(item_id)) : 
                                        bytes1(i_floor)
                ;
            }
        }
        rr.row = row;
        rr.items = item_row;
    }

    function drawRow(uint8 rowNum, RoomInfo memory r) internal view returns (FullRow memory fr) {
        RawRow memory rr = getRowData(rowNum, r);
        bytes memory row = rr.row;
        string memory output;
        for(uint i=0; i<COLS; i++) {
            if(i < r.room_x || i >= r.room_x + r.room_width) {
                if(rowNum==r.door_pos_lr+2) {
