        require(_exists(tokenId), "ERC721: Token has not been minted");
        require(row < ROWS, "Row number out of bounds");

        // Room info struct
        RoomInfo memory r = genRoomData(tokenId, "Token");
        uint8 dx = r.room_x + r.door_pos_tb + 2;

        string memory output;
        if(row < r.room_y) {
            if(r.door_side_tb==0) output = string(abi.encodePacked(output, repeatChar(32, dx), items[i_path], repeatChar(32, COLS-(dx+1))));  //svgFooter));
            else output = string(abi.encodePacked(output, repeatChar(32, COLS)));
        } else 
        if(row >= r.room_y + r.room_height) {
            if(r.door_side_tb==1) output = string(abi.encodePacked(output, repeatChar(32, dx), items[i_path], repeatChar(32, COLS-(dx+1))));  //svgFooter));
            else output = string(abi.encodePacked(output, repeatChar(32, COLS)));
        } else {
            FullRow memory fr = drawRow(row-r.room_y, r);
            output = string(abi.encodePacked(output, fr.output));
        }            

        return output;
    }

