    function repeatChar(uint8 char, uint256 length) internal pure returns (bytes memory b) {
        b = new bytes(length);
        for(uint256 i=0; i<length; i++) b[i]=bytes1(char);
    }  

    function genRoomData(uint256 tokenId, string memory seed) internal view returns (RoomInfo memory r) {
        uint256 rand_value = uint256(random(string(abi.encodePacked(seed, toString(tokenId)))));
        // Convert to an array of 32 bytes
        bytes memory rand_data = toBytes(rand_value);
        // Room info struct
        r.token_id = tokenId;
        // Calculate room side door is on top / bottom
        r.door_side_tb = uint8(rand_data[0]) % 2;    
        console.log("Door side TB = %s", r.door_side_tb);
        // Calculate room side door is on top / bottom
        r.door_side_lr = uint8(rand_data[1]) % 2;    
        console.log("Door side LR = %s", r.door_side_lr);
        // Calculate room height.  Min should be half 
        r.room_height = uint8((uint8(rand_data[2]) % (ROWS / 2)) + (ROWS / 2)); 
        console.log("Room height = %s", r.room_height);
        // Calculate room width
        r.room_width = uint8((uint8(rand_data[3]) % (COLS / 2)) + (COLS / 2)); 
        console.log("Room width = %s", r.room_width);
        // Calculate room x start
        r.room_x = r.room_width == COLS ? uint8(0) : uint8((COLS - r.room_width) / 2);
        console.log("Room start x = %s", r.room_x);
        // Calculate room y start
        r.room_y = r.room_height == ROWS ? uint8(0) : uint8((ROWS - r.room_height) / 2);
        console.log("Room start y = %s", r.room_y);
        // Calculate door position
        r.door_pos_tb = uint8(rand_data[4]) % (r.room_width - 4);
        r.door_pos_lr = uint8(rand_data[5]) % (r.room_height - 4); 
        console.log("Door pos TB = %s, LR = %s", r.door_pos_tb, r.door_pos_lr);

        return r;
    }

    function toString(uint256 value) internal pure returns (string memory) {
    // Inspired by OraclizeAPI's implementation - MIT license
    // https://github.com/oraclize/ethereum-api/blob/b42146b063c7d6ee1358846c198246239e9360e8/oraclizeAPI_0.4.25.sol

        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }

